from random import randint
from time import time

class QSort:
  def __partition(self, arr, low, high, i, j):
    mid = low
    pivot = arr[high]
    
    while mid <= high :
        if arr[mid] < pivot:
            arr[low], arr[mid] = arr[mid], arr[low]
            low += 1
            mid += 1
        elif arr[mid] == pivot:
            mid += 1
        elif arr[mid] > pivot:
            arr[high], arr[mid] = arr[mid], arr[high]
            high -= 1

    # update i and j
    i = low - 1
    j = mid # or high+1

    return i, j
  
  def quickSort(self, array, low, high):
    if low < high:
        i = low
        j = high
        i,j = self.__partition(array, low, high, i, j)
        self.quickSort(array, low, i)
        self.quickSort(array, j, high)

